import React from "react";
import "./NavBarCard.css";

import HomeImage from '../assets/Home.svg'; // Import the Home.svg image
import SearchImage from '../assets/S.svg'; // Import the Home.svg image

const NavBarCard = () => {
  const searchImg = "../assets/search.svg";
  const items = [
    { title: "home", img: HomeImage }, // Use the imported image here
    { title: "search", img: searchImg },
  ];

  const classes = "navbar";

  return (
    <div className={classes}>
      {items.map((item, index) => (
        <div key={index}>
          <img src={item.img} alt={item.title} />
          <div>{item.title}</div>
        </div>
      ))}
    </div>
  );
};

export default NavBarCard;
